import React from 'react';
import { useState } from 'react';
import { Link } from 'react-router-dom';
import styles from './SignUp.module.scss';

export const SignUp = () => {
    const [email, setEmail] = useState('')
    const [pasw, setPasw] = useState('')

    const some = (async (e, p) => {
        const rawResponse = await fetch('https://society-capital.herokuapp.com/api/login', {
            method: 'POST',
            headers: {
                'username': e,
                'password': p
            }
        })
        const content = rawResponse.json()
        console.log(content)
    })

    return (
        <div className={styles.wrapper}>
            <div className={styles.container}>
                <div className={styles.content}>
                    <div className={styles.text}>
                        Sign up
                    </div>
                    <div className={styles.form}>
                        <div className={styles.formOne}></div>
                        <div className={styles.formTwo}></div>
                        <div className={styles.formThree}></div>
                        <input placeholder='First Name'></input>
                        <input placeholder='Last Name'></input>
                        <input placeholder='E-mail'></input>
                        <input placeholder='Password'></input>
                        <input placeholder='Repeat Password'></input>
                    </div>
                    <button onClick={() => some(email, pasw)}>Submit</button>
                </div>
            </div>
        </div>
    )
}

export default SignUp;
